import React from 'react';

import {
    BrowserRouter,
    Route,
    Switch,
} from 'react-router-dom'

import Auth from './Auth';
import Login from './Login';
import LoginInstructor from './LoginInstructor';
import LoginStudent from './LoginStudent';
import Register from './Register';
import RegisterInstructor from '.RegisterInstructor';
import RegisterStudent from '.RegisterStudent';

export default () => (
  <BrowserRouter>
      <Switch>
        <Route exact path="/loginInstructor" render={props => <LoginInstructor {...props}/>}/>
        <Route exact path="/loginStudent" render={props => <LoginStudent {...props}/>}/>
        <Route exact path="/login" render={props => <Login {...props}/>}/>
        <Route exact path="/registerInstructor" render={props => <RegisterInstructor {...props}/>}/>
        <Route exact path="/registerStudent" render={props => <RegisterStudent {...props}/>}/>
        <Route exact path="/register" render={props => <Register {...props}/>}/>
        <Route exact path="/auth" render={props => <Auth {...props}/>}/>
      </Switch>
  </BrowserRouter>
);
